b'\x00\x00\xca\x00\x94\x01\x5e\x02\x28\x03\xf2\x03\xbc\x04\x86\x05'\
b'\x50\x06\x1a\x07\xe4\x07\xae\x08\x00\x00\x00\x00\x00\x00\x00\x00'\
b'\x00\x00\x78\x09'

_mvfont = memoryview(_font)
_mvi = memoryview(_index)
ifb = lambda l : l[0] | (l[1] << 8)

def get_ch(ch):
    oc = ord(ch)
    ioff = 2 * (oc - 48 + 1) if oc >= 48 and oc <= 63 else 0
    doff = ifb(_mvi[ioff : ])
    width = ifb(_mvfont[doff : ])

    next_offs = doff + 2 + ((width - 1)//8 + 1) * 40
    return _mvfont[doff + 2:next_offs], 40, width

